import React, {Component} from 'react';
import './App.css';
import ProfilePage from "../ProfilePage/ProfilePage";
import DialogsPage from "../DialogsPage/DialogsPage";
import {Route} from "react-router";
import {BrowserRouter} from "react-router-dom";


const AppComponent = (props) => {

    return (
        <BrowserRouter>
            <div>
                <Route exact path='/'
                       render={() => <ProfilePage addPost={props.addPost}
                                                  changeCurrentPost={props.changeCurrentPost}
                                                  user={props.user}
                                                  defaultCurrentPost={props.defaultCurrentPost} posts={props.posts}/>}/>
                <Route exact path='/dialogs' render={() => <DialogsPage showDialogsCorrespondents={props.showDialogsCorrespondents}
                                                                        dialogsCorrespondents={props.dialogsCorrespondents}
                                                                        messages={props.messages}
                                                                        currentCorrespondentId={props.currentCorrespondentId}
                                                                        showDialog={props.showDialog} />}/>
            </div>
        </BrowserRouter>
    );
};

export default AppComponent;
